.debugger-launch-attach-header {
  align-items: baseline;
  margin-bottom: 1em;
  text-overflow: ellipsis;
  width: 100%;
  display: flex;
}
atom-panel.modal.debugger-launch-attach-container {
  flex: 1;
  margin-left: 0;
  max-width: 100%;
  position: absolute;
  display: flex;
  height: initial;
  overflow: scroll;
  font-family: 'Roboto', 'Lucida Grande', 'Segoe UI', Ubuntu, Cantarell, sans-serif;
  font-size: 12pt;
}
div.debugger-launch-attach-container {
  padding: 5px;
}
.debugger-launch-attach-actions {
  display: flex;
  flex: 1;
  justify-content: flex-end;
  padding-top: 10px;
  position: relative;
  right: 8px;
  bottom: 8px;
}
.debugger-launch-connection {
  color: #64B5F6;
  font-weight: bold;
  cursor: pointer;
}
.debugger-launch-connection:hover {
  text-decoration: underline;
}
.debugger-launch-attach-tabs {
  align-items: center;
  display: flex;
  flex-flow: row wrap;
}
.debugger-launch-attach-container .nuclide-tabs .tab-bar .tab .title {
  overflow-x: hidden;
}
.debugger-provider-tab {
  text-overflow: ellipsis;
}
.debugger-launch-attach-tabcontent {
  background: #1d1f21;
  min-height: 30em;
  overflow: scroll;
  padding: 10px;
  position: relative;
  max-height: calc(100vh - 195px);
  margin-bottom: 10px;
}
atom-panel.modal.debugger-config-dialog {
  margin-top: 100px;
  max-width: none;
  width: auto;
}
